","type":"ColumnDataSource"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 42.52 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 511 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 4997.59 s &lt;/li&gt;\n&lt;li&gt; transfer time: 24.26 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.32.2.21:38621 &lt;/li&gt;\n          &lt;li&gt; Workers: 128 &lt;/li&gt;\n          &lt;li&gt; Threads: 128 &lt;/li&gt;\n          &lt;li&gt; Memory: 1.86 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.09.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.09.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_jobqueue import SLURMCluster\nfrom distributed import Client\n\nfrom dask.distributed import performance_report, get_task_stream\n\n#import logging\n#logging.basicConfig(format='%(levelname)s:%(message)s', level=logging.DEBUG)\n\ncores = 32\nnodes = 4\n\ncluster = SLURMCluster(memory          = '{}g'.format(16*cores),\n                       processes       = cores,\n                       name            = 'testdask-${JOB_ID}',\n                       cores           = cores,\n                       queue           = 'photon',\n                       local_directory = '/tmp',\n                       death_timeout   = '100000000000s',\n                       walltime        = '01:00:00',\n                       header_skip     = ['-n 1'], \n                       env_extra       = ['JOB_ID=${SLURM_ARRAY_JOB_ID}_${SLURM_ARRAY_TASK_ID}'],\n                       job_extra       = ['--ntasks-per-node=1', '--array=0-{}'.format(nodes-1), '--exclusive']) \n\ncluster.scale(jobs=1)\nclient = Client(cluster)\n\nclient.get_versions(check=True)\n\n\n#import pdb; pdb.set_trace() \n#client.upload_file('../../root/root_rdfenv-ucx-2/lib/DistRDF/Backends/Dask/Backend.py')\n\nimport ROOT\nROOT.gROOT.SetBatch(True)\nRDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\n\n\ndef dimuonSpectrum(df):\n\n    # Select events with exactly two muons\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n\n    # Select events with two muons of opposite charge\n    df_os = df_2mu.Filter(\"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\"Dimuon_mass\", \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    hist.GetValue() # triggers the event loop\n\n\nif __name__ == '__main__':\n    \n    #filelist = [\"input_files/dimuon/f{}.root\".format(i) for i in range(1, 101)]\n    #df = RDataFrame(\"Events\", filelist, npartitions=256, daskclient=client) \n   \n    #import pdb; pdb.set_trace()\n   \n    for r in range(2):\n        filelist = [\"input_files/dimuon/f{}.root\".format(i+r) for i in range(1, 101)]\n        df = RDataFrame(\"Events\", filelist, npartitions=256, daskclient=client)\n        client.wait_for_workers(cores*nodes)\n        with performance_report(filename=\"dask-report100-cold_present_{}.html\".format(r)):\n            dimuonSpectrum(df)\n        with performance_report(filename=\"dask-report100-hot_present_{}.html\".format(r)):\n            dimuonSpectrum(df)\n\n    client.close()\n\n        &lt;/pre&gt;\n        "},"id":"5823","type":"Div"},{"attributes":{"months":[0,6]},"id":"5982","type":"MonthsTicker"},{"attributes":{},"id":"5742","type":"UnionRenderers"},{"attributes":{"days":[1,8,15,22]},"id":"5939","type":"DaysTicker"},{"attributes":{"data":{"bottom":[0,1,2,3],"color":["#64CB5D","#64CB5D","#64CB5D","#287A8E"],"filename":["","/hpcscratch/user/ikabadzh/root/root_build/lib/DistRDF/Backends/Dask/Backend.py","/hpcscratch/user/ikabadzh/root/root_build/lib/DistRDF/Backends/Base.py","/hpcscratch/user/ikabadzh/root/root_build/lib/ROOT/_facade.py"],"left":[0,0,0,0],"line":["","return mapper(current_range)\n","with open(outfilepath, \"a+\") as f:\n","elif hasattr(gbl_namespace, name):\n"],"line_number":[0,93,166,196],"name":["","dask_mapper","mapper","_fallback_getattr"],"percentage":["100.0%","100.0%","0.0%","0.0%"],"right":[1,0.9999959061861622,2.0469069189547676e-06,2.0469069189547676e-06],"time":["4885.42 s","4885.40 s","10.00 ms","10.00 ms"],"top":[1,2,3,4],"width":[1,0.9999959061861622,2.0469069189547676e-06,2.0469069189547676e-06]},"selected":{"id":"5920"},"selection_policy":{"id":"5919"}},"id":"5424","type":"ColumnDataSource"},{"attributes":{"child":{"id":"5822"},"title":"Scheduler Logs"},"id":"5832","type":"Panel"},{"attributes":{"child":{"id":"5461"},"title":"Scheduler Profile (administrative)"},"id":"5827","type":"Panel"},{"attributes":{},"id":"5959","type":"YearsTicker"},{"attributes":{},"id":"5895","type":"BasicTickFormatter"},{"attributes":{"base":60,"mantissas":[1,2,5,10,15,20,30],"max_interval":1800000.0,"min_interval":1000.0,"num_minor_ticks":0},"id":"5935","type":"AdaptiveTicker"},{"attributes":{"days":[1,4,7,10,13,16,19,22,25,28]},"id":"5952","type":"DaysTicker"},{"attributes":{"child":{"id":"5497"},"title":"Worker Profile (administrative)"},"id":"5826","type":"Panel"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"5934","typ
